const { IconButton } = require("@material-ui/core")
const { Language } = require("@material-ui/icons")


const LanguageChanger = ()=>{
    return(
        <div>
            <IconButton size={'medium'} color={'white'}>
                <Language/>
            </IconButton>
        </div>
    )
}

export default LanguageChanger
